const fs = require('fs');
 function convertToMongoFormat(allProducts) {
  // First, flatten the nested array structure
  const flattenedProducts = allProducts.flat();

  return flattenedProducts.map(product => {
    // Generate MongoDB-like ObjectId (12-byte hex string)
    const generateObjectId = () => {
      const timestamp = Math.floor(Date.now() / 1000).toString(16).padStart(8, '0');
      const random = Math.floor(Math.random() * 16777215).toString(16).padStart(6, '0');
      return timestamp + random;
    };

    // Process image URLs (keep original format with images1, images2, etc.)
    const processImages = (imageString) => {
      if (!imageString) return [];
      return imageString.split(',')
        .map(img => img.trim())
        .filter(img => img.length > 0)
        .map(img => {
          if (img.startsWith('http')) return img;
          return `https://example.com/${img.replace(/^\/+/, '')}`;
        });
    };

    const images = processImages(product.product_images);
    const mainImage = images[0] || '';

    // Create features table in the exact format from the example
    const createFeaturesTable = () => {
      let features = '<p data-mce-fragment="1"><b data-mce-fragment="1">Specifications</b></p>\n';
      features += '<p data-mce-fragment="1"><b data-mce-fragment="1">In The Box</b></p>\n';
      features += '<p data-mce-fragment="1">1 Product</p>\n';
      features += '<table class="table table-bordered" data-mce-fragment="1">\n<tbody data-mce-fragment="1">\n';
      
      // General section
      features += '<tr data-mce-fragment="1">\n<td data-mce-fragment="1"><b data-mce-fragment="1">General</b></td>\n<td data-mce-fragment="1"><br data-mce-fragment="1"></td>\n</tr>\n';
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Product Title</td>\n<td data-mce-fragment="1">${product.product_title || ''}</td>\n</tr>\n`;
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Category</td>\n<td data-mce-fragment="1">${product.product_cat || ''}</td>\n</tr>\n`;
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Color</td>\n<td data-mce-fragment="1">${product.product_color !== '.' ? product.product_color : ''}</td>\n</tr>\n`;
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Size</td>\n<td data-mce-fragment="1">${product.product_size || ''}</td>\n</tr>\n`;
      
      // Price section
      features += '<tr data-mce-fragment="1">\n<td data-mce-fragment="1"><b data-mce-fragment="1">Price Details</b></td>\n<td data-mce-fragment="1"><br data-mce-fragment="1"></td>\n</tr>\n';
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">MRP</td>\n<td data-mce-fragment="1">₹${product.product_mrp || ''}</td>\n</tr>\n`;
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Selling Price</td>\n<td data-mce-fragment="1">₹${product.product_our_price || ''}</td>\n</tr>\n`;
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Discount</td>\n<td data-mce-fragment="1">${product.product_off || '0'}%</td>\n</tr>\n`;
      
      // Features section
      features += '<tr data-mce-fragment="1">\n<td data-mce-fragment="1"><b data-mce-fragment="1">Features</b></td>\n<td data-mce-fragment="1"><br data-mce-fragment="1"></td>\n</tr>\n';
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Fast Delivery</td>\n<td data-mce-fragment="1">${product.product_f_assured === 'Yes' ? 'Yes' : 'No'}</td>\n</tr>\n`;
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">EMI Available</td>\n<td data-mce-fragment="1">${product.product_emi !== '0' ? 'Yes' : 'No'}</td>\n</tr>\n`;
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Bank Offers</td>\n<td data-mce-fragment="1">${product.product_bank_offers || 'None'}</td>\n</tr>\n`;
      
      // Rating section
      features += '<tr data-mce-fragment="1">\n<td data-mce-fragment="1"><b data-mce-fragment="1">Customer Reviews</b></td>\n<td data-mce-fragment="1"><br data-mce-fragment="1"></td>\n</tr>\n';
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Rating</td>\n<td data-mce-fragment="1">${product.rating || 'N/A'} out of 5</td>\n</tr>\n`;
      features += `<tr data-mce-fragment="1">\n<td data-mce-fragment="1">Total Reviews</td>\n<td data-mce-fragment="1">${product.rating_count || '0'}</td>\n</tr>\n`;
      
      features += '</tbody>\n</table>\n<p data-mce-fragment="1"> </p>';
      
      return features;
    };

    return {
      "_id": {
        "$oid": generateObjectId()
      },
      "Title": product.product_title || '',
      "color": product.product_color && product.product_color !== '.' ? product.product_color : '',
      "size": product.product_size || '',
      "storage": '', // Not available in source data
      "selling_price": product.product_our_price || '',
      "mrp": product.product_mrp || '',
      "features": createFeaturesTable(),
      "images": mainImage,
      "images1": images[0] || mainImage,
      "images2": images[1] || mainImage,
      "images3": images[2] || mainImage,
      "images4": images[3] || mainImage,
      "__v": 0
    };
  });
}

